const theme = {
    colors: {
      background: 'radial-gradient(#282c34cc, #282c34)',
      black: '#282c34',
      blue: '#a0e9fd',
      lightBlue: '#caf3fe',
      white: 'white',
    },
    transition: '0.3s',
  }

export default theme;
